class PermyScript{constructor(t){this.string=t}get compile(){return this.encapsulate.split.nest.set_to_main.as_object}get set_to_main(){return new PermyScript(`{ "main": ${this.string} }`)}get split(){return new PermyScript(this.string.replaceAll("|",'","'))}get nest(){let t=this.string;for(let e=0;e<(this.string.match(/\).+]+/g)||[]).length;e++)t=`${t}]`;for(let e=0;e<(this.string.match(/\(/g)||[]).length;e++)t=`${t}]`;t=t.replaceAll("(",'", ["');const e=t=>t.replace(")","");return t=t.replace(/(\))"]*$/g,e),t=t.replace(/\)/g,'", ["'),new PermyScript(t)}get encapsulate(){return new PermyScript(`["${this.string}"]`)}get as_object(){return JSON.parse(this.string)}}module.exports=PermyScript;